import { useToken } from '../../hooks/TokenContext'
import { useUser } from '../../hooks/UserContext'
import './Profile.css'

function Profile() {
  const [username] = useUser()
  const [token] = useToken()
  console.log(username)
  console.log(token)
  return (
    <div id="profile-id">
        <p>{username}</p>
    </div>  
  )
}

export default Profile
